const LoadingSpinner = () => {
return (
    <div className="flex items-center justify-center">
    <div className="relative">
        <div className="w-12 h-12 rounded-full border-4 border-gray-100 animate-spin border-t-emerald-500"></div>
        <div className="absolute top-0 left-0 w-12 h-12 rounded-full border-4 border-emerald-500 opacity-20 animate-pulse"></div>
    </div>
    </div>
);
};

export default LoadingSpinner;
